pub enum Cw20HandleMsg {
    Transfer {
        recipient: HumanAddr,
        amount: Uint128,
    },
    Burn {
        amount: Uint128,
    },
    Send {
        contract: HumanAddr,
        amount: Uint128,
        msg: Option<Binary>,
    },
    IncreaseAllowance {
        spender: HumanAddr,
        amount: Uint128,
        expires: Option<Expiration>,
    },
    DecreaseAllowance {
        spender: HumanAddr,
        amount: Uint128,
        expires: Option<Expiration>,
    },
    TransferFrom {
        owner: HumanAddr,
        recipient: HumanAddr,
        amount: Uint128,
    },
    SendFrom {
        owner: HumanAddr,
        contract: HumanAddr,
        amount: Uint128,
        msg: Option<Binary>,
    },
    BurnFrom {
        owner: HumanAddr,
        amount: Uint128,
    },
    Mint {
        recipient: HumanAddr,
        amount: Uint128,
    },
}

pub enum Cw20QueryMsg {
    Balance {
        address: HumanAddr,
    },
    TokenInfo {
    },
    Allowance {
        owner: HumanAddr,
        spender: HumanAddr,
    },
    Minter {
    },
    AllAllowances {
        owner: HumanAddr,
        start_after: Option<HumanAddr>,
        limit: Option<u32>,
    },
    AllAccounts {
        start_after: Option<HumanAddr>,
        limit: Option<u32>,
    },
}
